def make_pared(value, pared):
    n = 1 / 10
    print(len(pared))
    print(len(pared[0]))
    for x in range(len(pared)):
        for y in range(len(pared[x])):
            v = pared[x][y]
            if v == value:
                continue
            color = (0, 0, 1)
            if v == 0:
                color = (1, 1, 1)
            if v == 3:
                color = (1, 0, 0)    
            if v == 4:
                color = (0, 1, 0)
            # print(y * n - 1, 1 - x * n, 1)
            cubo(y * n - 1, 1 - x * n, 1, color)


